import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Loading = () => {
  return (
    <Text
      style={{
        fontSize: 15,
        fontWeight: "bold",
        color: "#039EBD",
        textAlign: "center",
      }}
    >
      Loading...
    </Text>
  );
};

export default Loading;
